public class Solution {
    private const int Mod = 1000000007;

    private int CountDistinctPrimeFactors(int number) {
        int count = 0;
        for (int i = 2; i * i <= number; i++) {
            if (number % i == 0) {
                while (number % i == 0) {
                    number /= i;
                }
                count++;
            }
        }
        if (number > 1) count++;
        return count;
    }

    public int MaximumScore(IList<int> nums, int k) {
        var scores = nums.Select(num => new { Value = num, PrimeScore = CountDistinctPrimeFactors(num) })
            .OrderByDescending(num => num.PrimeScore)
            .ThenByDescending(num => num.Value)
            .Take(k)
            .Select(num => (long)num.Value)
            .ToList();

        long result = 1;
        foreach (var score in scores) {
            result = (result * score) % Mod;
        }

        return (int)result;
    }
}
